import React, { Component } from 'react';

import { Header, Grid, Divider } from 'semantic-ui-react'

// CONTAINER IMPORTS
import SessionTable from './SessionTable'
import SessionForm from './SessionForm'

class SessionContainer extends Component {

  render() {
    return (
      <Grid
        style={{
          marginBottom: '5em'
        }}
      >
        <Grid.Row fluid>
          <Grid.Column
            floated='left'
            width={8}
          >
            <Header as='h2'>Latest Session Entry</Header>
            <p>Enter information about your most recent session, or a session you forgot about in the past here.</p>
            <SessionForm />
          </Grid.Column>
          <Grid.Column
            floated='right'
            width={7}
          >
            <Header as='h2'>Last 5 Sessions</Header>
            <p>How have you been performing recently?</p>
            <SessionTable />
          </Grid.Column>
          <Divider vertical/>
        </Grid.Row>
      </Grid>
    )
  }

}


export default SessionContainer
